// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DocumentVerification {
    struct Certificate {
        string name;
        uint academicYear;
        uint date;
        string issuer;
        string gpa;
        string behavior;
        string certificateType;
        string certificateId;
        string fileHash;
    }

    struct University {
        string name;
        address[] authorizedAddresses;
    }

    mapping(address => bool) public contractAdmins;
    mapping(address => University) public universities;
    mapping(string => Certificate) public certificates;

    address[] public adminAddresses;
    address[] public universityAddresses;

    address public contractOwner;

    modifier onlyOwner() {
        require(msg.sender == contractOwner, "Caller is not the owner");
        _;
    }

    modifier onlyAdmin() {
        require(contractAdmins[msg.sender], "Caller is not an admin");
        _;
    }

    modifier onlyAuthorized(address universityAddress) {
        bool isAuthorized = false;
        for(uint i = 0; i < universities[universityAddress].authorizedAddresses.length; i++) {
            if (universities[universityAddress].authorizedAddresses[i] == msg.sender) {
                isAuthorized = true;
                break;
            }
        }
        require(isAuthorized, "Caller is not authorized for this university");
        _;
    }

    constructor() {
        contractOwner = msg.sender;
    }

    function addAdmin(address admin) public onlyOwner {
        contractAdmins[admin] = true;
        adminAddresses.push(admin);
    }

    function removeAdmin(address admin) public onlyOwner {
        contractAdmins[admin] = false;
    }

    function addUniversity(address universityAddress, string memory name) public onlyAdmin {
        University memory newUniversity = University({
            name: name,
            authorizedAddresses: new address[](0)
        });
        universities[universityAddress] = newUniversity;
        universityAddresses.push(universityAddress);
    }

    function authorizeAddress(address universityAddress, address toAuthorize) public onlyAdmin {
        universities[universityAddress].authorizedAddresses.push(toAuthorize);
    }

    function addCertificate(
        address universityAddress,
        string memory name,
        uint academicYear,
        uint date,
        string memory issuer,
        string memory gpa,
        string memory behavior,
        string memory certificateType,
        string memory certificateId,
        string memory fileHash
    ) public onlyAuthorized(universityAddress) {
        Certificate memory newCertificate = Certificate({
            name: name,
            academicYear: academicYear,
            date: date,
            issuer: issuer,
            gpa: gpa,
            behavior: behavior,
            certificateType: certificateType,
            certificateId: certificateId,
            fileHash: fileHash
        });
        certificates[fileHash] = newCertificate;
    }

    function validateCertificate(string memory fileHash) public view returns (bool) {
        bytes memory tempEmptyStringTest = bytes(certificates[fileHash].name);
        if(tempEmptyStringTest.length == 0) {
            return false;
        }
        else {
            return true;
        }
    }

    function getAdmins() public view returns (address[] memory) {
        return adminAddresses;
    }

    function getUniversities() public view returns (address[] memory) {
        return universityAddresses;
    }

    function getUniversityDetails(address universityAddress) public view returns (string memory, address[] memory) {
        return (universities[universityAddress].name, universities[universityAddress].authorizedAddresses);
    }
}
